import React from "react";

function UserInitializer({ socket, onUserSelect, currentUser, otherUsers }) {
  const handleUserSelect = (userId) => {
    if (socket && socket.readyState === WebSocket.OPEN) {
      const message = { type: "selectUser", userUUID: userId };
      socket.send(JSON.stringify(message));
    }
  };

  return (
    <div className="user-initializer">
      <p className="user" onClick={() => handleUserSelect(currentUser)}>
        {currentUser}
      </p>
      {otherUsers.map((user, index) => (
        <p key={index} className="user" onClick={() => handleUserSelect(user)}>
          {user}
        </p>
      ))}
    </div>
  );
}

export default UserInitializer;
